var setPos=function(e,d){var a=document.getElementsByClassName("radio-wph");for(var b=0;b<a.length;++b){var c=document.getElementById(a[b].id);if(e.id!=c.id&&c.childNodes[0].className&&c.childNodes[0].className=="checked"){c.childNodes[0].className=""}}document.getElementById("hf_objectposwph").value="";var f=document.getElementById(e.id);for(b=0;b<f.childNodes.length;b++){if(f.childNodes[b].className&&f.childNodes[b].className=="checked"){f.childNodes[b].className=""}else{f.childNodes[b].className="checked";document.getElementById("hf_objectposwph").value=d}}};